    data: |
      SELECT ALL - col2 - col0 AS col2, - ( + 95 ) AS col1 FROM tab2 (FORMAT parquet) AS cor0 WHERE col2 IS NOT NULL;
  - name: tab2

outputs:
  - name: q5568.out
    data: |
      -104	-95
      -133	-95
      -69	-95
